import PrivateMessage from "../message/PrivateMessage";

const PrivateMessages = () => {
  return (
    <div className="private_message-container">
      <h1 className="private_message-header">Messages</h1>
      <ul>
        <PrivateMessage />
        <PrivateMessage />
        <PrivateMessage />
        <PrivateMessage />
      </ul>
    </div>
  );
};

export default PrivateMessages;
